import React from 'react';

import { useState, useEffect } from 'react';

const Fetch = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch('http://127.0.0.1:8000//api/lift/config/')
      .then((res) => {
        console.log(res)
        return res.json();
      })
      .then((data) => {
        console.log(data);
        setData(data);
      });
  }, []);
  return (
    <div>
        {
            data ? <p></p> : <p>Hello</p>
        }
    </div>
  );
};
export default Fetch;
